basicMap/basicMap-style.html.body:
个性化地图
腾讯 iOS 3D 地图 SDK自 v4.1.1起，支持使用个性化地图模版，通过选择不同的模版可实现底图配色风格的切换。
前往选择个性化地图模版，设定好模板后可根据地图模板ID切换个性化地图。
示例代码：
[self.mapView setMapStyle: (int)];    //个性化地图的ID从 1 开始，具体数量依据个人配置为准

假如用户在个性化配置平台中的样式按次序依次是：经典，墨渊，白浅，玉露。
如图：

通过接口调用时设置样式如下：
//个性化地图的ID从 1 开始，具体数量依据个人配置为准
// case1: 设置为1（在配置列表中，第1个是经典）
[self.mapView setMapStyle: 1];
// case2: 设置为2（在配置列表中，第2个是墨渊）
[self.mapView setMapStyle: 2];
// case3: 设置为3（在配置列表中，第3个是白浅）
[self.mapView setMapStyle: 3];

则最终显示的效果中，样式依次分别为经典，白浅。

basicMap/basicMap-building.html.body:
显示建筑物
腾讯 iOS 3D 地图 SDK支持建筑物是否显示的开关配置，也支持是否显示3D立体效果的配置。当显示3D建筑物时，地图有一定的倒伏角效果会更好。
接口介绍：



功能
实现接口




开启/关闭建筑物 (默认为YES)
@property (nonatomic) BOOL showsBuildings;


显示/关闭3D效果（默认为YES）
@property (nonatomic) BOOL shows3DBuildings;



示例代码：
// 显示建筑物
self.mapView.showsBuildings = YES;
// 显示建筑物的3D效果
self.mapView.shows3DBuildings = YES;

效果图：(左边为3D效果，右边为非3D效果)

basicMap/offline.html.body:
离线地图


地图SDK 4.3.5版本中新增了离线地图功能，通过下载指定城市的离线地图，可以在设备处于离线模式时仍然可以显示该区域的地图。

开启离线地图
离线地图功能默认情况下处于关闭状态，需要通过mapView新增的接口打开该功能：
self.mapView.offlineMapEnable = YES;


下载离线地图

离线地图QOfflineMap类采用单例模式调用，首次使用离线地图之前，需要调用- (void)reloadItems:方法来重建离线地图数据，否则离线地图数据可能为空值：
 [[QOfflineMap sharedOfflineMap] reloadItems:^(BOOL setUpSuccess) {
     NSLog(@"setup:%d", setUpSuccess);
 }];


获取离线文件列表，包括全国概要、直辖市、省市、城市信息：
 NSArray *items = [QOfflineMap sharedOfflineMap].items;


该方法会返回包含了QOfflineItem元素或QOfflineProvince的数组，这两个类分别包含了城市、省市的信息
QOfflineItem属性列表如下：
  | 属性 | 说明
  | --- | ---
  | NSString name | 城市名称
  | NSString pinyin | 城市名称的拼音
  | long long size | 该城市地图的数据包大小
  | QOfflineItemStatus status | 离线文件状态，包含：QOfflineItemStatusNone：文件不存在QOfflineItemStatusUpdated：文件已更新QOfflineItemStatusOutdated：文件已过期

QOfflineProvince是QOfflineItem的子类，在其基础上添加了items属性用于保存该省份的所有城市信息
  | 属性 | 说明
  | --- | ---
  | NSArray  *items | 省份包含的所有城市离线文件信息



获取离线文件列表之后，可以根据需要下载指定城市的离线文件，以北京市为例：
 // 取出北京
 NSArray *items = [[QOfflineMap sharedOfflineMap] items];
 QOfflineItem *bjItem;
 for (QOfflineItem *item in items) {
     if ([item.name isEqualToString:@"北京市"]) {
         bjItem = item;
     }
     break;
 }

 [[QOfflineMap sharedOfflineMap] downloadItem:bjItem callback:^(QOfflineItem * _Nonnull downloadItem, QOfflineItemDownloadStatus status, id  _Nonnull info) {

     if (status == QOfflineItemDownloadNone) {
         NSLog(@"无下载项目");
     } else if (status == QOfflineItemDownloading) {
         NSLog(@"下载中");
     } else if (status == QOfflineItemDownloadCompleted) {
         NSLog(@"下载完成");
     } else {
         NSLog(@"下载失败");
     }
 }];




取消下载
正在下载的离线地图数据，可以通过以下接口来取消地图的下载：
[[QOfflineMap sharedOfflineMap] cancelDownload:item];

调用了下载方法的离线地图数据，会自动添加到下载列表中，可以通过以下接口来获取正在下载的离线地图数据：
@property (nonatomic, readonly) NSArray  *downloadingItems;


删除离线文件
已经下载完毕的离线地图数据，可以通过以下接口来删除该区域的地图数据：
[[QOfflineMap sharedOfflineMap] deleteItem:item];

camera/camera-rect.html.body:
视野范围设置
视野范围设置分为：

设置地图当前可见范围(mapRect)
设置地图当前可视区域(region)


设置地图可见范围

QMapView类中的的setVisibleMapRect:方法用于设置地图显示范围，并使mapRect四周保留insets指定的边界区域，示例如下：
/**
 *  @brief 设置当前地图可见范围的mapRect，并保留insets指定的边界区域
 *
 *  @param mapRect  目标mapRect
 *  @param insets   要嵌入的边界
 *  @param animated 是否采用动画
 */
[self.mapView setVisibleMapRect:QMapRectMake(220911420, 101575260, 24000, 38592)
                    edgePadding:UIEdgeInsetsMake(10, 10, 10, 10)
                       animated:YES];


设置地图可见区域

region表示地图中的一块区域，通常用于将地图当前视野调整到指定的区域范围显示，示例如下：
// 创建region
QCoordinateRegion region = QCoordinateRegionMake(CLLocationCoordinate2DMake(39.927642, 116.559448), QCoordinateSpanMake(1, 1));

/**
 *  @brief 设定当前地图的region
 *
 *  @param region   要设定的地图范围，用经纬度的方式表示
 *  @param insets   要嵌入的边界
 *  @param animated 是否采用动画
 */
[self.mapView setRegion:region
            edgePadding:UIEdgeInsetsMake(10, 10, 10, 10)
               animated:YES];


常用方法



展示Annotation、Polyline和多边形：

获取构成Annotation、Polyline和多边形的的坐标
计算这些坐标构成的最小外接region
更新地图显示region
 // 点标注坐标
 CLLocationCoordinate2D coordinates[4];
 coordinates[0] = CLLocationCoordinate2DMake(40.041554,116.271508);
 coordinates[1] = CLLocationCoordinate2DMake(40.041652,116.274619);
 coordinates[2] = CLLocationCoordinate2DMake(40.03863,116.271787);
 coordinates[3] = CLLocationCoordinate2DMake(40.038745,116.275134);

 // 计算最小外接区域
 QCoordinateRegion region = QBoundingCoordinateRegionWithCoordinates(coordinates, 4);
 // 更新可见region
 [self.mapView setRegion:region edgePadding:UIEdgeInsetsZero animated:YES];


效果如图所示：





展示Circle

圆形的数据模型QCircle，包含了构成圆形的中心点和半径，circle.boundingMapRect属性表示该圆形的外接矩形
更新地图显示mapRect
 // 获取外接矩形
 QMapRect maprect = _circle.boundingMapRect;
 // 更新显示mapRect
 [self.mapView setVisibleMapRect:maprect edgePadding:UIEdgeInsetsMake(20, 20, 20, 20) animated:YES];


效果如图所示：






常见问题


setVisibleMapRect:edgePadding:animated:方法中的edgePadding参数的作用

edgePadding参数接收UIEdgeInsets类型的值，显示指定的mapRect范围时，可以在四周加入边界。如展示Circle案例中，左右各预留20的边界，这样可以让Circle显示在更靠中间的位置


调用setVisibleMapRect:edgePadding:animated:方法没有效果，或者出现了地图移动到指定的范围之外

设置edgePadding参数时，如果UIEdgeInsets的left-right和top-bottom值的和不能超过屏幕的宽高。

camera/camera-limit.html.body:
限制显示区域
地图SDK可以设置地图只能在指定的区域范围内移动，如果希望设置仅显示在一块矩形区域，可使用此功能。
使用方法如下：
// 矩形四角坐标
CLLocationCoordinate2D coordinates[4];
coordinates[0] = CLLocationCoordinate2DMake(40.041554,116.271508);
coordinates[1] = CLLocationCoordinate2DMake(40.041652,116.274619);
coordinates[2] = CLLocationCoordinate2DMake(40.03863,116.271787);
coordinates[3] = CLLocationCoordinate2DMake(40.038745,116.275134);

// 计算最小外接区域
QCoordinateRegion region = QBoundingCoordinateRegionWithCoordinates(coordinates, 4);

// 将region转为maprect
QMapRect maprect = QMapRectForCoordinateRegion(region);

/**
 * @brief 根据边界留宽显示限制地图区域范围(2D北朝上场景时)
 * @param mapRect 待调整的地理范围
 * @param mode    限制地区区域的对齐方式，分等宽对齐和等高对齐
 */
[self.mapView setLimitMapRect:maprect mode:QMapLimitRectFitWidth];

限制区域显示的限制方式 QMapLimitRectFitMode，分别以区域宽度为参考值和以区域高度为参考值：



限制模式
说明




QMapLimitRectFitWidth
此模式会以 mapRect宽度为参考值限制地图的控制区域，保证横向区域完全展示


QMapLimitRectFitHeight
此模式会以 mapRect高度为参考值限制地图的控制区域，保证纵向区域完全展示



当传入的mapRect的值都为0时，即可取消区域限制，示例如下：
[self.mapView setLimitMapRect:QMapRectMake(0, 0, 0, 0) mode:QMapLimitRectFitWidth];

常见用法


将地图的显示范围固定在一个区域，通过拖动地图也无法离开这个区域，如将区域固定在腾讯北京总部大楼：
 [self.mapView setLimitMapRect:rectangle.boundingMapRect mode:QMapLimitRectFitWidth];

overlay/overlay-annotation.html.body:
点标记
点标记，即Annotation，用于在地图中标记位置，如POI位置、车辆位置等带有位置属性的事物。
腾讯地图SDK点标记功能分为两个部分，点标记数据对象(Annotation)和点标记的信息窗(CalloutView)。
Annotation和CalloutView提供了默认样式，同时也可以自定义样式。

添加默认样式点标记

SDK提供了默认的点标记数据对象(QPointAnnotation)和默认的大头针样式点标注View(QPinAnnotationView)，基本使用步骤如下：

创建点标记数据对象，QPointAnnotation提供了点标记的位置、标题等信息：
 QPointAnnotation *pointAnnotation = [[QPointAnnotation alloc] init];
 pointAnnotation.coordinate = CLLocationCoordinate2DMake(40.040219, 116.273348);
 // 点标注的标题
 pointAnnotation.title = @"腾讯";
 // 副标题
 pointAnnotation.subtitle = @"腾讯北京总部";

 // 将点标记添加到地图中
 [self.mapView addAnnotation:pointAnnotation];


实现协议的mapView:viewForAnnotation:方法，创建点标注：
 - (QAnnotationView *)mapView:(QMapView *)mapView viewForAnnotation:(id)annotation {
     if ([annotation isKindOfClass:[QPointAnnotation class]]) {
         static NSString *annotationIdentifier = @"pointAnnotation";
         QPinAnnotationView *pinView = (QPinAnnotationView *)[self.mapView dequeueReusableAnnotationViewWithIdentifier:annotationIdentifier];
         if (pinView == nil) {
             pinView = [[QPinAnnotationView alloc] initWithAnnotation:annotation reuseIdentifier:annotationIdentifier];
             pinView.canShowCallout = YES;
         }

         return pinView;
     }

     return nil;
 }


效果如下图所示：




自定义样式点标记

腾讯地图SDK可以自定义点标记样式，包括自定义点标记和自定义点标记信息窗口：
1. 自定义点标记图标
如果默认的点标记样式无法满足需求，可以在创建QPinAnnotationView时自定义点标记图标：
// 修改点标记图标
pinView.image = [UIImage imageNamed:@"greenPin"];

效果如图所示：

2. 自定义信息窗口
通过自定义信息窗口，可以展示更多标记点的信息，步骤如下：
自定义信息窗口类，示例代码如下：
#import 

@interface CustomCalloutView : UIView
// 图标
@property (nonatomic, strong) UIImage *image;
// 标题
@property (nonatomic, strong) NSString *title;
// 地址
@property (nonatomic, strong) NSString *address;
@end


#import "CustomCalloutView.h"

@interface CustomCalloutView ()
@property (nonatomic, strong) UILabel *titleLabel;
@property (nonatomic, strong) UILabel *addressLabel;
@property (nonatomic, strong) UIImageView *coverImageView;
@end

@implementation CustomCalloutView

- (instancetype)initWithFrame:(CGRect)frame {
    if (self = [super initWithFrame:frame]) {
        self.backgroundColor = [UIColor colorWithRed:124/255.0 green:238/255.0 blue:240/255.0 alpha:1];
        [self initSubviews];
    }
    return self;
}

- (void)initSubviews {
    CGFloat margin = 5;

    // 图标控件
    self.coverImageView = [[UIImageView alloc] initWithFrame:CGRectMake(margin, margin, 50, 50)];
    [self addSubview:self.coverImageView];

    // 标题控件
    self.titleLabel = [[UILabel alloc] initWithFrame:CGRectMake(margin * 2 + 50, margin, 50, 20)];
    self.titleLabel.font = [UIFont systemFontOfSize:15];
    self.titleLabel.textColor = [UIColor blackColor];
    [self addSubview:self.titleLabel];

    // 地址控件
    self.addressLabel = [[UILabel alloc] initWithFrame:CGRectMake(margin * 2 + 50, 35, 50, 20)];
    self.addressLabel.font = [UIFont systemFontOfSize:12];
    self.addressLabel.textColor = [UIColor blackColor];
    [self addSubview:self.addressLabel];
}

- (void)setTitle:(NSString *)title {
    _title = title;
    self.titleLabel.text = title;
}

- (void)setAddress:(NSString *)address {
    _address = address;
    self.addressLabel.text = address;
}

- (void)setImage:(UIImage *)image {
    _image = image;
    self.coverImageView.image = image;
}

@end

在创建Annotation时，指定customCalloutView属性，示例代码如下：
- (QAnnotationView *)mapView:(QMapView *)mapView viewForAnnotation:(id)annotation
{
    if ([annotation isKindOfClass:[QPointAnnotation class]])
    {
        static NSString *pointReuseIndetifier = @"pointReuseIndetifier";

        QPinAnnotationView *annotationView = (QPinAnnotationView *)[self.mapView dequeueReusableAnnotationViewWithIdentifier:pointReuseIndetifier];

        // 取出自定义信息窗口控件
        CustomCalloutView *customCalloutView = (CustomCalloutView *)annotationView.customCalloutView;

        if (annotationView == nil)
        {
            annotationView = [[QPinAnnotationView alloc] initWithAnnotation:annotation reuseIdentifier:pointReuseIndetifier];
            annotationView.canShowCallout = YES;

            // 如果annotationView为新创建，同时创建customCalloutView并赋值
            customCalloutView = [[CustomCalloutView alloc] initWithFrame:CGRectMake(0, 0, 15 + 100, 10 + 50)];
            annotationView.customCalloutView = customCalloutView;
        }

        customCalloutView.image = [UIImage imageNamed:@"good"];
        customCalloutView.title = annotation.title;
        customCalloutView.address = annotation.subtitle;

        return annotationView;
    }

    return nil;
}

3. 效果如图所示：


点标记的删除和批量操作

单独添加一个点标记，已经在添加默认样式点标记中介绍了，本小结将介绍如何删除单个点标记、批量添加点标记和批量删除点标记。

删除单个点标记：
  [self.mapView removeAnnotation:annotation];


批量添加点标记：
  [self.mapView addAnnotations:annotationArray];


批量删除点标记
  [self.mapView removeAnnotations:annotationArray];




点标记的动画效果和拖拽效果

点标记在添加到地图中时，可以添加动画效果，点标记会添加掉落动画：
annotationView.draggable = YES;

通过对点标记进行长按手势，可以将点标记拖动到其他的位置：
annotationView.animatesDrop = YES;


点标记的事件监听

点标记默认可以响应点击事件并切换到选中状态，事件响应可以控制开启、关闭。实现中的代理方法，可以监听点标记的事件。

点标记的事件响应开关：
  // 默认为YES, 当为NO时view忽略触摸事件
  annotationView.enable = NO;

  // 获取当前点标记是否处于选中状态
  if (annotationView.selected) {
      ...
  }


点标注的监听方法
  // 当mapView新添加annotation views时，调用此接口
  - (void)mapView:(QMapView *)mapView didAddAnnotationViews:(NSArray *)views;

