常见问题


为什么多边形的连线是中间交叉的？

在创建QPolygon数据模型时，需要注意传入的坐标要按照顶点连接顺序传入，保证图形闭合时顶点连线不会交叉。

overlay/overlay-tile.html.body:
自定义瓦片图层
简介
什么是瓦片
瓦片是组成地图形貌的基本元素，腾讯地图SDK将世界地图在不同的缩放级别下，以高清256*256或者标准512*512为单元划分成地图瓦片数据。 除了内置的瓦片覆盖层（热力图、海外图、个性化图层等）之外，用户可以通过自定义QTileOverlay来实现添加自定义瓦片功能。
关于地图坐标系和缩放级别
腾讯地图坐标是使用GCJ-02坐标（投影坐标系），您可以使用腾讯坐标转换服务将其他坐标系坐标转换成GCJ-02坐标。目前可支持编辑的缩放级别为[3-18]，您也可以通过self.mapView.minZoomLevel和self.mapView.maxZoomLevel接口获取当前最大和最小缩放级别，来调整对应的配置。
什么是瓦片覆盖层
瓦片覆盖层，是为了展示地图个性化数据提供能力，您可以把某些区域内的地图瓦片，覆盖成独特风格的图片数据。地图SDK提供了非常简便的接口方法，来实现自定义瓦片能力。
如开发者没有基础地图绘制数据，腾讯地图提供了云端个性化地图能力，可以支持在线修改地图元素的样式 以期望满足个性化配置样式的需求。
如开发者有室内CAD相关的数据，希望在地图上进行展示，我们提供了商务级室内地图合作能力，能帮助开发者更快的完成需求。
如开发者有生产瓦片地图数据的能力，还不知道如何接入的话，接下来我们通过两部分讲解，完成这部分的指导：

添加瓦片覆盖层
移除瓦片覆盖层


添加瓦片覆盖层



创建瓦片图层数据模型类LocalTile继承自QTileOverlay，并重载方法loadTileAtPath: result:加载本地瓦片图片，示例代码如下：
 - (void)loadTileAtPath:(QTileOverlayPath)path result:(void (^)(NSData *, NSError *))result
 {
     NSString *imagePath = [NSString stringWithFormat:@"%d-%d-%d.png", (int)path.z, (int)path.x, (int)path.y];

     NSString *filePath = [[[NSBundle mainBundle] resourcePath] stringByAppendingPathComponent:@"localTiles"];

     // 使用本地瓦片图片创建NSData
     NSData *data = [NSData dataWithContentsOfFile:[filePath stringByAppendingPathComponent:imagePath]];

     if (data.length != 0)
         {
         // 将data数据传入回调block中
         result(data,nil);
         }
     else
         {
         NSError *error = [NSError errorWithDomain:@"QTileLoadErrorDomain" code:-1 userInfo:@{NSLocalizedDescriptionKey: @"load tile data error"}];
         result(nil, error);
         }

 }


创建LocalTile类，并添加到mapView中，示例代码如下：
 LocalTile *localTile = [[LocalTile alloc] init];
 [self.mapView addOverlay:localTile];


实现\协议的mapView: viewForOverlay:方法，并创建瓦片图层QTileOverlayView，示例如下：
 - (QOverlayView *)mapView:(QMapView *)mapView viewForOverlay:(id)overlay
 {
     // 生成瓦片图的render
     if ([overlay isKindOfClass:[QTileOverlay class]]) {
         QTileOverlayView *render = [[QTileOverlayView alloc] initWithTileOverlay:overlay];

         return render;
     }

     return nil;
 }


效果如下图所示：




移除瓦片覆盖层

您可以直接调用removeOverlay:方法进行移除，示例如下：
[self.mapView removeOverlay:_localTile];

overlay/overlay-heat.html.body:
热力图覆盖层
简介
热力图是一种瓦片覆盖层，它能够在地图上表达数据的密度和分布状况。下面是一张截图效果：

开发者可以通过自定义热力图的渐变颜色和其他属性，来调整自己需要的样式。下面我们将分三部分，帮助开发者熟悉热力图的配置：

添加一个简单的热力图
自定义热力图样式
移除热力图


添加一个简单的热力图

为了添加一个简单的热力图，你需要提前准备好带有坐标分布的数据集。基本使用步骤如下：

准备热力节点需要的坐标分布数据，示例如下：
 // 纬度 经度 权值
 116.895579    24.306521    43


遍历所有数据创建QHeatTileNode热力节点对象，保存在数组中，然后添加到mapView中，示例如下：
 self.nodes = [NSMutableArray array];

 // 将所有的热力节点数据保存在数组中遍历    
 [dataStringArray enumerateObjectsUsingBlock:^(NSString *  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {

     NSArray *ar = [obj componentsSeparatedByCharactersInSet:[NSCharacterSet whitespaceCharacterSet]];

     // 纬度.
     double lat = [ar[1] doubleValue];
     // 经度.
     double lon = [ar[0] doubleValue];
     // 权值.
     double val = [ar[2] doubleValue];

     QHeatTileNode *node = [[QHeatTileNode alloc] init];
     // 热力节点坐标
     node.coordinate = CLLocationCoordinate2DMake(lat, lon);
     // 热力节点权值
     node.value      = val;

     [self.nodes addObject:node];
 }];

 QHeatTileOverlay *heat = [[QHeatTileOverlay alloc] initWithHeatTileNodes:self.nodes];


最后，实现的mapView: viewForOverlay:方法，创建QHeatTileOverlayView，示例如下：
 - (QOverlayView *)mapView:(QMapView *)mapView viewForOverlay:(id)overlay
 {
     if ([overlay isKindOfClass:[QHeatTileOverlay class]]) {
         QHeatTileOverlayView *render = [[QHeatTileOverlayView alloc] initWithTileOverlay:overlay];
         return render;
     }
     return nil;
 }


效果图如下




设置热力图样式


QHeatTileOverlay提供一些属性来满足自定义样式的热力效果，包括：衰变半径、透明度、颜色梯度。为了能够正常显示新的图层，改变样式之后需要重新reload图层。
QHeatTileOverlay为热力图的数据对象，下表为属性说明：



属性
说明




NSInteger decayRadius
衰变半径，单位：point。范围越大计算耗时越长，默认20。建议100以内。


CGFloat opacity
透明度，默认为0.6，范围：0-1。


QHeatTileGradient *gradient
颜色梯度



QHeatTileGradient为热力图的颜色梯度对象，下表为属性说明：



属性
说明




NSArray *colors
颜色变化数组


NSArray *startPoints
颜色变化节点，需为严格递增数组，区间为[0, 1.0]



更改属性基本使用方法如下：

更改热力图颜色梯度
 // 自定义的色值
 self.heatTileOverlay.gradient = [[QHeatTileGradient alloc] initWithColor:@[[UIColor grayColor],[UIColor brownColor], [UIColor blueColor],[UIColor greenColor],[UIColor yellowColor],[UIColor redColor]] andWithStartPoints:@[@(0.1),@(0.3),@(0.5), @(0.6), @(0.8),@(0.9)]];


设置热力半径
 // 设置热力图半径
 [self.heatTileOverlay setDecayRadius:50];


调用QHeatTileOverlayView的reloadData方法，刷新热力图：
 QHeatTileOverlayView *heatView = (QHeatTileOverlayView *)[self.mapView viewForOverlay:self.heatTileOverlay];
 [heatView reloadData];


