overlay/overlay-heat-vector.html.body:
蜂窝热力图


腾讯地图SDK自4.3.4版本起，将支持蜂窝热力图功能，该功能可以让热力图以蜂窝形状或正方形状绘制，并支持点击区域显示详细信息功能，示例图如下：



蜂窝热力图使用步骤与热力图类似，下面我们将分三部分，帮助开发者熟悉热力图的配置：

添加指定样式的蜂窝热力图
配置蜂窝热力图的参数
点击热力图返回区域信息
移除热力图


添加指定样式的蜂窝热力图
为了添加一个简单的热力图，你需要提前准备好带有坐标分布的数据集。基本使用步骤如下：

准备热力节点需要的坐标分布数据，示例如下：
 // 纬度 经度 权值
 116.895579    24.306521    43


遍历所有数据创建QHeatNode热力节点对象，保存在数组中：
 ```objc
 NSMutableArray  *nodes = [NSMutableArray array];
 {
 // 读取本地包含热力节点数据的文件
 NSString *filePath = [[NSBundle mainBundle] pathForResource:@"vectorHeat" ofType:@"json"];

 NSData *data = [NSData dataWithContentsOfFile:filePath];

 NSError *err = [[NSError alloc] init];
 NSDictionary *dict = [NSJSONSerialization JSONObjectWithData:data options:kNilOptions error:&err];

 NSArray *array = [dict objectForKey:@"data"];


    for (NSDictionary *dict in array) {

        double ul_lat = [[dict valueForKey:@"ul_lat"] doubleValue];
        double ul_lng = [[dict valueForKey:@"ul_lng"] doubleValue];
        double lr_lat = [[dict valueForKey:@"lr_lat"] doubleValue];
        double lr_lng = [[dict valueForKey:@"lr_lng"] doubleValue];

        // 经纬度
        double lat = (ul_lat / 100 + lr_lat / 100) / 2;
        double lon = (ul_lng / 100 + lr_lng / 100) / 2;

        // 权值
        double val = [[dict valueForKey:@"count"] doubleValue];

         // 创建热力节点
        QHeatNode *node = [[QHeatNode alloc] init];
        node.coordinate = CLLocationCoordinate2DMake(lat, lon);
        node.value      = val;

        [nodes addObject:node];
    }
}
```

创建热力图属性对象QVectorHeatOverlayOption，指定蜂窝热力图的属性：
 QVectorHeatOverlayOption *option = [[QVectorHeatOverlayOption alloc] init];
 // 显示时边框单元的宽度
 option.size = 3000 * 1;
 // 显示时边框之间的间隔
 option.gap = 100;
 // 热力图的类型
 option.type = QVectorHeatTypeHoneyComb;


通过节点对象数组和热力图属性对象，创建QVectorHeatOverlay并添加到mapView中：
 QVectorHeatOverlay *heat = [[QVectorHeatOverlay alloc] initWithHeatNodes:nodes option:option];

 [self.mapView addOverlay:self.heatTileOverlay];


效果如下图所示：




配置蜂窝热力图的参数
QVectorHeatOverlayOption对象用于配置热力图的属性，常用属性如下表所示：



属性
说明




QVectorHeatType type
QVectorHeatTypeHoneyComb：蜂窝形QVectorHeatTypeSquare：正方形


CLLocationDistance size
显示时边框单元的宽度（内切圆的直径） 单位：米


CLLocationDistance gap
显示时边框之间的间隔 单位：米


CGFloat opacity
透明度，取值范围[0,1]，默认为1不透明


CGFloat minZoom
最小显示级别，默认3


CGFloat maxZoom
最大显示级别，默认20


NSArray\ *colors
颜色变化数组，与startPoints配合使用。注意：colors和startPoints两数组长度必须一致且不能为0


NSArray *startPoints
颜色变化起点，需为递增数组，每个元素代表权重的一个节点(此节点为显示颜色的切换点)



配置热力图颜色方式如下所示：
option.startPoints = @[@0.0, @0.6, @0.8];
option.colors = @[[UIColor colorWithRed:0 green:0 blue:1 alpha:0.3],
                  [UIColor colorWithRed:0 green:0 blue:1 alpha:0.6],
                  [UIColor colorWithRed:0 green:0 blue:1 alpha:0.9]];



点击热力图返回区域信息
QVectorHeatAggregationUnit表示一个热力图展示单元，其基本属性如下表所示：



属性
说明




CLLocationCoordinate2D center
中心点坐标


float intensity
当前热力值，求和后的权重


NSArray *nodeIndices
落在此单元区域内的所有热力点的索引数组



QVectorHeatOverlay提供的 getAggregationUnit: 方法可以根据传入的坐标参数来获取该坐标点的热力图单元对象，如果该坐标点没有热力单元对象，则返回nil。搭配mapView的点击方法 mapView: didTapAtCoordinate: 可以获得点击点的热力单元：
- (void)mapView:(QMapView *)mapView didTapAtCoordinate:(CLLocationCoordinate2D)coordinate
{
    QVectorHeatAggregationUnit *unit = [self.heatTileOverlay getAggregationUnit:coordinate];
    if (unit)
    {
        NSLog(@"count=%ld. intensity=%f. || center=(%f,%f). point=(%f,%f)", unit.nodeIndices.count, unit.intensity, unit.center.latitude, unit.center.longitude, QMapPointForCoordinate(unit.center).x, QMapPointForCoordinate(unit.center).y);
    }
}


移除热力图
调用mapView的removeOverlay:即可将热力图移除：
[self.mapView removeOverlay:self.heatTileOverlay];

overlay/overlay-custom-layer.html.body:
个性化图层
图展示所用的瓦片并放到合适的位置，提升如景区、园区在地图中的展现效果。平台提供服务进行瓦片制作、图层存储、权限管理等，对于调用自定义瓦片图层（QCustomLayer）接口的使用成本大幅降低。
第一步 创建图层

通过SDK使用个性化图层能力前，需要用户通过位置服务官网的编辑平台创建图层并生成图层id。网址：https://lbs.qq.com/dev/console/customLayer/guide

第二步 添加图层


1. 工程配置
腾讯地图 iOS SDK 接入示例请参考：https://github.com/TencentLBS/TencentMapDemo_iOS 中的 README 文档。
地图其他功能使用请一同参考上述链接。
2. 申请用户key

访问 控制台 申请密钥。
填写应用名称，描述，验证码，阅读并同意使用条款。
申请完成后，通过密钥设置勾选地图SDK选项，获得使用权限。

3. 在项目中添加key
在使用地图SDK时，需要对应用做Key机制验证，如果地图不添加key，地图将不能运行，控制台会显示没有key的错误日志。
在AppDelegate.m中配置key方法如下：
#import 


- (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions
{
    // Override point for customization after application launch.
    [QMapServices sharedServices].APIKey = @"您的key";
    return YES;
}

4. 创建自定义图层类
使用个性化图层功能时，需初始化自定义图层的类 （QCustomLayer），它包含一个图层的唯一标识 （layerID），在个性化图层编辑平台成功上传图层时得到的其标识字符串。初始化 QCustomLayer 后，把得到的图层标识进行赋值，示例如下：
QCustomLayer *testlayer = [[QCustomLayer alloc] init];
testlayer.layerID = @"填入图层标识";

5. 添加自定义图层
当 QCustomLayer 类初始化完，并进行图层标识赋值后，就可以把自定义图层添加到地图上，示例如下：
// 将自定义图层添加到地图上
[self.mapView addCustomLayer:testlayer];

6. 移除自定义图层
当自定义图层不需要显示时，可以把对应的自定义图层在地图上移除，示例如下：
[self.mapView removeCustomLayer:testlayer];

overlay/overlay-opengl.html.body:
OpenGL绘制


腾讯地图SDK自v4.3.4起，将支持使用OpenGLES 2.0进行3D模型绘制，为开发者在地图上提供更灵活的样式绘制，加强显示效果，提升用户体验。
目前支持opengl相关接口有：

获取地图投影坐标矩阵：[mapview glProjectionMatrix]
获取地图视图坐标矩阵：[mapview glViewMatrix]
从经纬度转换成对应的地图坐标：[mapview glVertexForCoordinate:coordinate]
获取地图单位Point缩放比率：[mapview glPointRatio]
实现自定义渲染回调：- (void)mapViewDrawFrame:(QMapView *)mapView

我们将通过下面的示例代码，来说明以上接口如何进行使用

绘制3D立方体

声明顶点相关数据
 // 顶点坐标
 float _vertext[totalVertexCount * 3];
 // 索引
 short _indecies[indexCount];
 // 每个顶点的颜色
 float _color[totalVertexCount * 4];
 // 立方体的缩放因
 float _scale[16];


初始化数据
 - (void)initVertext
 {
       // 初始化每个顶点坐标。本例中基于像素单位
       _vertext[i] = vertext[i] * kEdgeLength;
         // ...
       // 索引
       _indecies[i] = indices[i];
         // ...
       // 每个顶点的颜色
       _color[i] = colors[i];
         // ...
       // 立方体的缩放因子
       _scale[i] = scale[i];
     // ...
 }

 - (void)initShader
 {
     // ...
 }


创建drawCube方法绘制立方体
 ```objc
 // 绘制固定像素大小的立方体

(void)drawCube
{
  // 0. 准备opengl渲染环境
  // 1.  传入opengl立方体的顶点坐标和和各自的颜色值
  glEnableVertexAttribArray(_vertexLocation);
  glVertexAttribPointer(_vertexLocation, 3, GL_FLOAT, false, 0, _vertext);
  glEnableVertexAttribArray(_colorLocation);
  glVertexAttribPointer(_colorLocation, 4, GL_FLOAT, false, 0, _color);
  // 2. 为了固定像素大小绘制立方体，需要将绽放因子_scale乘以glPointRatio比例值
  // 显示屏幕point宽度时需要乘以此scale
  float scalePerPoint = [self.mapView glPointRatio];
// 当前级别下的像素宽
  GLKMatrix4 sm = GLKMatrix4MakeScale(scalePerPoint, scalePerPoint, scalePerPoint);
  for (int i = 0; i 
  viewMatrix[i] = vm.m[i];
  projectionMatrix[i] = pm.m[i];
  // 当前级别下的像素宽
  _scale[i] = sm.m[i];
  }
  // 3.　应用地图的矩阵glViewMatrix和glProjectionMatrix
  // 当前地图view矩阵
  float  map_viewMatrix = [self.mapView glViewMatrix];
  // 当前地图projection矩阵
  float  map_projectionMatrix = [self.mapView glProjectionMatrix];
  float viewMatrix[16], projectionMatrix[16];
  GLKMatrix4 pm = GLKMatrix4MakeWithArray(map_projectionMatrix);
  GLKMatrix4 vm = GLKMatrix4MakeWithArray(map_viewMatrix);
  glUniformMatrix4fv(_scaleMatrixLocation, 1, false, _scale);
  glUniformMatrix4fv(_viewMatrixLocation, 1, false, viewMatrix);
  glUniformMatrix4fv(_projectionMatrixLocation, 1, false, projectionMatrix);
  // 4. 调用opengl的渲染接口，绘制固定像素大小的立方体
  glDrawElements(GL_TRIANGLES, 36, GL_UNSIGNED_SHORT, _indecies);




    // 说明：    
    // 本例中为固定像素大小的立方体。如果需要地理尺寸的绘制内容，需要将其每个经纬度点转换为对应的opengl坐标.
    // 此时不再需要使用glPointRatio
    // 样例如下：
    //  for (int i = 0; i 
实现自定义渲染回调
 // 地图渲染每一帧过程中都会调用此接口
 - (void)mapViewDrawFrame:(QMapView *)mapView
 {
     [self drawCube];
 }




