overlay/overlay-groundOverlay.html.body:
GroundOverlay


地图SDK 4.3.5版本新增了自定义图层GroundOverlay功能，该功能可以在地图的指定位置上，添加一张自定义图片。

创建自定义图层数据对象
GroundOverlay为图层的数据对象，通过数据对象并调用mapView的addOverlay:方法，将图层数据添加到地图中。
GroundOverlay的创建提供了以下两个类方法：

根据指定区域生成一个groundOverlay

接口如下所示：
 /**
   * @brief 根据指定区域生成一个groundOverlay
   * @param bounds 指定的经纬度区域
   * @param icon 绘制使用的图片
   * @return 新生成的groundOverlay对象
   */
 + (QGroundOverlay *)groundOverlayWithBounds:(QCoordinateBounds)bounds
                                        icon:(UIImage*)icon;


QCoordinateBounds为包含了东北角和西南角经纬度坐标的结构体，这两个方向坐标围成的矩形范围区域，就是自定义图层的区域：
 typedef struct {
     CLLocationCoordinate2D northEast; /// 东北角点经纬度坐标
     CLLocationCoordinate2D southWest; /// 西南角点经纬度坐标
 } QCoordinateBounds;


示例代码如下：
 QCoordinateBounds bounds;
 bounds.northEast = CLLocationCoordinate2DMake(40.041936,116.274711);
 bounds.southWest = CLLocationCoordinate2DMake(40.03865,116.271739);

 UIImage *image = [UIImage imageNamed:@"groundOverlay"];
 QGroundOverlay *overlay = [QGroundOverlay groundOverlayWithBounds:bounds icon:image];
 [self.mapView addOverlay:overlay];






根据指定经纬度坐标生成一个groundOverlay

接口如下所示：
 /**
   * @brief 根据指定经纬度坐标生成一个groundOverlay
   * @param position 图片在地图上的经纬度坐标
   * @param zoomLevel 不损失精度绘制原始图片的地图等级
   * @param anchor 绘制图片的锚点. 左上角为(0,1). 有效区间[0,1]
   * @param icon   绘制使用的图片
   * @return 新生成的groundOverlay对象
   */
 + (QGroundOverlay *)groundOverlayWithCoordinate:(CLLocationCoordinate2D)position
                                       zoomLevel:(CGFloat)zoomLevel
                                          anchor:(CGPoint)anchor
                                            icon:(UIImage*)icon;


示例代码如下：
 UIImage *image = [UIImage imageNamed:@"groundOverlay"];
 QGroundOverlay *groundOverlay = [QGroundOverlay groundOverlayWithCoordinate:CLLocationCoordinate2DMake(40.040219,116.273348) zoomLevel:17 anchor:CGPointMake(0.5, 0.5) icon:image];

 [self.mapView addOverlay:groundOverlay];






将自定义图层添加到地图中
GroundOverlay图层数据对象添加到mapView之后，实现\的mapView: viewForOverlay:方法，创建GroundOverlayView视图对象，将图层显示在地图中，示例代码如下：
- (QOverlayView *)mapView:(QMapView *)mapView viewForOverlay:(id)overlay {
    if ([overlay isKindOfClass:[QGroundOverlay class]]) {
        _groundOverlayView = [[QGroundOverlayView alloc] initWithOverlay:overlay];
        return _groundOverlayView;
    }

    return nil;
}

示例图如下所示：


调整自定义图层的层级
GroundOverlayView提供的displayLevel属性，可以修改图层在地图中的层级，从而调整poi、图层、道路等之间的压盖关系。
/**
 * @brief 覆盖物的显示级别，决定了与POI等地理元素的压盖关系
 */
typedef NS_ENUM(NSInteger, QOverlayLevel) {
    QOverlayLevelAboveRoads = 0,    // 在道路之上楼块之下
    QOverlayLevelAboveBuildings,    // 在楼块之上POI之下
    QOverlayLevelAboveLabels        // 显示在所有POI之上
};

GroundOverlayView在道路之上，楼块之下：

GroundOverlayView在楼块之上，POI之下：

GroundOverlayView在道路之上，楼块之下：


更新GroundOverlay数据源
GroundOverlay数据对象通过构造方法添加到mapView之后，可以通过以下两个API来更新GroundOverlay的信息：
/**
 * @brief 更新GroundOverlay. 
 * @param bounds 图片的在地图的覆盖范围
 * @param icon   覆盖图片
 */
- (void)setGroundOverlayWithBounds:(QCoordinateBounds)bounds icon:(UIImage *)icon;
/**
 * @brief 更新GroundOverlay, 内部会自动计算覆盖物大小，以满足zoomLevel下显示大小为icon大小.
 * @param position 图片在地图上的经纬度坐标
 * @param zoomLevel  图片在地图尺寸等同于像素的zoom值
 * @param anchor 绘制图片的锚点. 左上角为(0,1). 有效区间[0,1]
 * @param icon       覆盖图片
 */
- (void)setGroundOverlayWithCoordinate:(CLLocationCoordinate2D)position
                             zoomLevel:(CGFloat)zoomLevel
                                anchor:(CGPoint)anchor
                                  icon:(UIImage *)icon;

search/search.html.body:
检索功能概述及接入
地图 SDK 提供的检索能力依托于腾讯地图开放平台提供的 WebService API，所有的检索接口都有配额限制，如果您希望更大的配额，请注册腾讯地图开发者并付费购买所需的配额。在使用检索功能前，请先阅读 WebService API 入门指南。
接入步骤

在腾讯地图控制台的Key管理页面，进入想要开启检索功能的Key设置页面，并勾选WebServiceAPI功能：


在AppDelegate文件中引入头文件，并在application: didFinishLaunchingWithOptions:方法中设置apiKey
 #import "AppDelegate.h"
 #import 

 @implementation AppDelegate

 - (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions {

     // 启用检索功能
     [QMSSearchServices sharedServices].apiKey = @"ApiKey";

     return YES;
 }

 @end


在使用检索功能的控制器中，引入QMSSearcher头文件，初始化QMSSearcher对象并指定当前控制器为代理：
 #import 

 @interface KeywordHintViewController () 
 @property (nonatomic, strong) QMSSearcher *mapSearcher;
 @end

 @implementation KeywordHintViewController

 - (void)viewDidLoad {
     [super viewDidLoad];

     self.mapSearcher = [[QMSSearcher alloc] initWithDelegate:self];
 }

gesture/gesture-custom.html.body:
自定义手势
简介
腾讯地图SDK除了提供的基本手势，也可以使用系统原生API来添加自定义手势，本小结通过实例来介绍如何实现通过长按手势在地图上添加Annotation。
自定义长按手势


创建长按手势，并将手势添加在mapView中：
 UILongPressGestureRecognizer *longPressGestureRecognizer = [[UILongPressGestureRecognizer alloc] initWithTarget:self action:@selector(handleLongPressAction:)];

 [self.mapView addGestureRecognizer:longPressGestureRecognizer];


在手势的监听方法中，获取点击的屏幕坐标，并将其转化为地图中的坐标，并创建Annotation：
 - (void)handleLongPressAction:(UIGestureRecognizer *)gestureRecognizer
 {
     if (gestureRecognizer.state == UIGestureRecognizerStateBegan)
     {
         CGPoint point = [gestureRecognizer locationInView:self.mapView];

         CLLocationCoordinate2D coordinate = [self.mapView convertPoint:point toCoordinateFromView:self.mapView];

         QPointAnnotation *annotation = [[QPointAnnotation alloc] init];
         annotation.coordinate = coordinate;

         [self.mapView addAnnotation:annotation];
     }
 }




常见问题


在地图中添加了单击手势，与地图的点击手势产生冲突怎么办？

为添加的手势设置代理，然后实现协议的gestureRecognizer: shouldRecognizeSimultaneouslyWithGestureRecognizer:方法，并返回YES，即可让地图同时处理多个手势。

utils/utils-cluster.html.body:
点聚合
简介
当地图上需要展示的marker过多，可能会导致界面上marker出现压盖，展示不全，并导致整体性能变差，用户使用卡顿的显现。针对此类问题，推出点聚合能力，将大量Maker通过聚合的方式进行展示。

点数据、聚合管理类介绍

QMUAnnotation点数据类
QMUAnnotation 类是可被聚合的原始点数据，用户获取数据后可创建对应的 QMUAnnotation。一般情况下以数组形式把大量的聚合点数据存储起来。
属性说明：



属性
说明




CLLocationCoordinate2D coordinate
地理坐标


NSString *title
标题


NSString *subtitle
副标题


QMUPoint point
代表其位置，被用于参与聚合运算。默认为墨卡托坐标



接口说明：
// 设置坐标
- (void)setCoordinate:(CLLocationCoordinate2D)newCoordinate

// 当子类有新添加字段时，子类有可能需要重载来帮助判断是不是同一个点
- (NSUInteger)hash; 

// 当子类有新添加字段时，子类有可能需要重载来帮助判断是不是同一个点
(BOOL)isEqual:(id)object;

初始化示例：
QMUAnnotation *anno = [[QMUAnnotation alloc] init];
anno.title = @"clusterAnno";
anno.coordinate = CLLocationCoordinate2DMake(latitude, longitude);

QMUClusterManager构建点聚合管理类
当构建好所需的聚合点数据后，需要一个点聚合管理类 QMUClusterManager 将聚合点数据进行管理。
QMUClusterManager 为聚合点功能的入口，通过此类的实例来配置聚合功能，和管理数据。
属性说明：



属性
说明




CGFloat distance
聚合的范围，单位为屏幕坐标。


id delegate
代理类，实现其方法可用于自定义聚合的效果


QMapView* map
map实例


int thresholdZoomlevel
当zoomLevel > thresholdZoomlevel时为只计算屏幕附近的聚合点；当zoomLevel如果设置为>18或



接口说明：
// 创建一个实例.
- (instancetype)initWithMap:(QMapView*)map;

// 添加原始被聚合点
- (void)addAnnotaion:(QMUAnnotation*)anno;

// 添加批量的原始被聚合点
- (void)addAnnotations:(NSArray*)annos;

// 移除原始被聚合点
- (void)removeAnnotaion:(QMUAnnotation*)anno;

// 移除批量的原始被聚合点
- (void)removeAnnotations:(NSArray*)annos;

// 移除所有的原始被聚合点
- (void)clearAnnotations;

/** @brief
 * 当你想强制重新聚合时调用。地图产生变化后需调用刷新聚合点状态
 * 如 mapView: regionDidChangeAnimated: gesture: 等地图区域状态回调接口
 * (当仅改配置如distance, threeholdZoomlevel时会需要)
 */
- (void)refreshCluster;

注意：如不在 mapView: regionDidChangeAnimated: gesture: 调用 refreshCluster, 当地图区域发生变化后，点聚合效果不会刷新，示例如下：
- (void)mapView:(QMapView *)mapView regionDidChangeAnimated:(BOOL)animated gesture:(BOOL)bGesture
{
    [self.manager refreshCluster];
}

初始化示例：
// 继承代理
@interface ClusterAnnoViewController () 
@end  

// 聚合点数据数组
NSArray* datas = [self loadData];
// 基于当前的 mapView 进行初始化
self.manager = [[QMUClusterManager alloc] initWithMap:self.mapView];
// 设置代理
self.manager.delegate = self;

self.manager.distance = 56;
// 将聚合点数据传入
[self.manager addAnnotations:datas];

QMUClusterProtocol协议
QMUClusterProtocol 用于配置自定义的聚合效果，用户通过- (BOOL)clusterAnnotation: withAnnotation:接口配置自定义的聚合效果。
// 决定特定的2个点是否需要被聚合,只有当返回YES且符合距离时才会被聚合，如果不实现则任意两原始点都被聚合
- (BOOL)clusterAnnotation:(QMUAnnotation* )anno1 withAnnotation:(QMUAnnotation*)anno2
{
   // TypedClustableAnnotation 为 QMUAnnotation 的子类
   TypedClustableAnnotation *l = (TypedClustableAnnotation*)anno1;
   TypedClustableAnnotation* r = (TypedClustableAnnotation*)anno2;

    // type 的值为4时，该点不会被聚合
    if (l.type == 4 || r.type == 4) {
       return NO;
    }
}

示例如下：左上角的一个点（ type 值为4）没有被聚合，其他的三个点被聚合在一起


构建点聚合View

通过 QMUClusterManager 将聚合点数据传入后，用户需要构建聚合点的 View 才能将数据显示在地图上。
QMUClusterAnnotation点聚合数据类
在回调mapView: viewForAnnotation:中可通过判断 annotation 是否为 QMUClusterAnnotation 类进而构建 QMUClusterAnnotationView 类，将数据显示在地图上。
QMUClusterAnnotation 代表了经过聚合计算后的单个聚合点数据，包含了当前范围的所有原始点。有可能有多个原始点，也有可能只有一个。
属性说明：



属性
说明 




NSUInteger count
该聚合点包含的原始点个数


NSMutableSet *items
该聚合点包含的所有原始点



QMUClusterAnnotationView点聚合视图
QMUClusterAnnotationView 预定义的聚合点样式 view，一般与QMUClusterAnnotation配套使用。它包含View本身，一个背景图片，一个显示文字，可修改显示效果后直接使用。
属性说明：



属性
说明




UIImageView *background
景图片


UILabel *displayText
显示的文字



构建聚合点 View 的示例：
- (QAnnotationView *)mapView:(QMapView *)mapView viewForAnnotation:(id)annotation
{
        // 判断是否为聚合点类  
    if ([annotation isKindOfClass:[QMUClusterAnnotation class]])
    {
        QMUClusterAnnotation* ca = (QMUClusterAnnotation*)annotation;

          // 根据聚合点包含的原始点个数设置样式 view
        if (ca.count > 1) {
            static NSString *clusterReuseIndetifier = @"cluster";

            QMUClusterAnnotationView *annotationView = (QMUClusterAnnotationView*)[mapView dequeueReusableAnnotationViewWithIdentifier:clusterReuseIndetifier];

              // 样式的背景色
            annotationView.backgroundColor = [UIColor colorWithRed:0.5 green:0.6 blue:0.45 alpha:0.8];
              // 显示的文字
            annotationView.displayText.text = [[NSNumber numberWithUnsignedInteger:ca.count] stringValue];

            if (ca.count >= 100) {
                        ......
            }
            else if (ca.count >= 10) {
              ......
            }
            ......
            ......
            return annotationView;
     }

    return nil;
}

效果示例图


更详细的设置请参考 demo

location/location.html.body:
基本定位功能
使用准备
腾讯地图SDK（iOS）封装了系统定位，方便用户使用，在使用定位功能前，需要向info.plist文件中添加定位权限：(以下二选一，两个都添加默认使用NSLocationWhenInUseUsageDescription）：
NSLocationWhenInUseUsageDescription：允许在前台使用时获取GPS的描述
NSLocationAlwaysUsageDescription：允许永久使用GPS的描述
开启定位

在创建mapView之后，可以通过setShowsUserLocation:方法来打开定位功能：
self.mapView.delegate = self;

// 开启定位
[self.mapView setShowsUserLocation:YES];

效果示例图如下：


定位模式

定位一共有地图跟踪三种模式，可以通过mapView的setUserTrackingMode:(QUserTrackingMode)mode方法来设置，支持的模式如下：



模式
说明




QUserTrackingModeNone
不追踪用户的location更新


QUserTrackingModeFollow
追踪用户的location更新


QUserTrackingModeFollowWithHeading
追踪用户的location与heading更新



注意：如果在QUserTrackingModeFollow和QUserTrackingModeFollowWithHeading模式下改变地图视野时，跟踪模式会转变为QUserTrackingModeNone，如果需要跟踪功能，则需要再次设置。

定位代理方法

开启定位功能之后，实现协议中的方法来监听定位的回调，当定位成功时将获取到 QUserLocation 对象，该对象包含的属性如下表所示：



属性
说明




CLLocation *location
定位的位置信息


CLHeading *heading
指向信息



代理方法示例如下：
// 中的定位回调函数
- (void)mapViewWillStartLocatingUser:(QMapView *)mapView
{
    NSLog(@"%s", __FUNCTION__);
}

- (void)mapViewDidStopLocatingUser:(QMapView *)mapView
{
    NSLog(@"%s", __FUNCTION__);
}

/**
 * @brief 用户位置更新后，会调用此函数
 * @param mapView 地图View
 * @param userLocation 新的用户位置
 * @param fromHeading 是否为heading 变化触发，如果为location变化触发,则为NO
 */
- (void)mapView:(QMapView *)mapView didUpdateUserLocation:(QUserLocation *)userLocation fromHeading:(BOOL)fromHeading
{
    NSLog(@"%s fromHeading = %d, location = %@, heading = %@", __FUNCTION__, fromHeading, userLocation.location, userLocation.heading);
}

/**
 * @brief  定位失败后，会调用此函数
 * @param mapView 地图View
 * @param error 错误号，参考CLError.h中定义的错误号
 */
- (void)mapView:(QMapView *)mapView didFailToLocateUserWithError:(NSError *)error
{
    NSLog(@"%s error = %@", __FUNCTION__, error);
}

/**
 * @brief 定位时的userTrackingMode 改变时delegate调用此函数
 * @param mapView 地图View
 * @param mode QMUserTrackingMode
 * @param animated 是否有动画
 */
- (void)mapView:(QMapView *)mapView didChangeUserTrackingMode:(QUserTrackingMode)mode animated:(BOOL)animated
{
    NSLog(@"%s mode = %d, animated = %d", __FUNCTION__, mode, animated);
}


自定义定位蓝点样式

iOS地图SDK的定位功能除了默认样式的定位蓝点图标外，还支持通过 QUserLocationPresentation 来自定义样式的定位图标和定位圈的填充颜色。
QUserLocationPresentation 属性说明：



属性
说明




UIImage *icon
定位图标


UIColor *circleFillColor
定位圈的填充色



自定义蓝点样式示例代码如下：
// 创建定位样式对象
QUserLocationPresentation *presentation = [[QUserLocationPresentation alloc] init];

// 定位图标
presentation.icon = [UIImage imageNamed:@"test_location_1"];
// 精度圈颜色
presentation.circleFillColor = [[UIColor grayColor] colorWithAlphaComponent:0.3];

// 配置定位样式
[self.mapView configureUserLocationPresentation:presentation];

示例图如下：

定位图标回调


地图SDK在4.3.5版本增加了点击定位图标调用回调方法的功能，基本使用步骤如下：

设置mapView的代理对象:
 self.mapView.delegate = self;


实现点击定位图标的代理方法:
 - (void)mapView:(QMapView *)mapView didTapMyLocation:(CLLocationCoordinate2D)location {
     NSLog(@"my location is: (%f, %f)", location.latitude, location.longitude);
 }



当点击定位图标时，会调用上述方法，并将当前用户定位的坐标传入该方法中。

other/other-distance.html.body:
距离计算
iOS地图SDK中提供了 QGeometry 工具类，该类中包含了地图中如坐标、位置等数据定义和工具方法，有关距离计算的方法如下：
/**
 *  @brief 返回两个 QMapPoint 之间的距离, 单位:米
 *
 *  @param a 点 a
 *  @param b 点 b
 *
 *  @return 距离值
 */
extern CLLocationDistance QMetersBetweenMapPoints(QMapPoint a, QMapPoint b);

/**
 *  @brief 返回两个经纬度之间的距离, 单位:米
 *
 *  @param a 点 a
 *  @param b 点 b
 *
 *  @return 距离值
 */
extern CLLocationDistance QMetersBetweenCoordinates(CLLocationCoordinate2D a, CLLocationCoordinate2D b);

以西二旗地铁站和腾讯北京总部为例计算，示例代码如下：
// 西二旗地铁站
CLLocationCoordinate2D coord1 = CLLocationCoordinate2DMake(40.053034, 116.306295);
// 腾讯北京总部大楼
CLLocationCoordinate2D coord2 = CLLocationCoordinate2DMake(40.040219, 116.273348);
CLLocationDistance distance = QMetersBetweenCoordinates(coord1, coord2);

// 两地距离：3149.288199
NSLog(@"%f", distance);
